// App.js

import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import Home from './Pages/Home';
import One from './Pages/One';
import Two from './Pages/Two';
import Three from './Pages/Three';
import Four from './Pages/Four';
import { AppBar, Toolbar, Typography, Button, IconButton, Container } from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';

const App = () => {
  return (
    <div id="appContainer">
      <AppBar position="static" color="primary">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu">
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" sx={{ flexGrow: 1 }}>
            Blog Title
          </Typography>
          <Button color="inherit" component={Link} to="/">
            Home
          </Button>
          <Button color="inherit" component={Link} to="/one">
            Instructional Methods and Strategies
          </Button>
          <Button color="inherit" component={Link} to="/two">
            Teacher Perceptions
          </Button>
          <Button color="inherit" component={Link} to="/three">
            Management Techniques
          </Button>
          <Button color="inherit" component={Link} to="/four">
            Lesson Plan Development
          </Button>
        </Toolbar>
      </AppBar>

      <div id="content">
        <Container>
          <Routes>
            <Route path="/" element={<Home />} />
            <Route path="/one" element={<One />} />
            <Route path="/two" element={<Two />} />
            <Route path="/three" element={<Three />} />
            <Route path="/four" element={<Four />} />
          </Routes>
        </Container>
      </div>
    </div>
  );
};

export default App;
